import axios from 'axios';
import { fetchdata } from '../Redux/Actions/fetchdataAction';
import { fetchdaata } from '../Redux/Type';


import { dataUrl } from './Url';


async function getdata(dispatch) {

    try {
      const response = await axios.get(dataUrl);
      dispatch( {      type: fetchdaata,     payload: response.data      })

    } catch (error) {
      console.error(error);
    }
  }
export {getdata}
